import React, { useEffect, useState } from "react";
import "./Home.css";
import { Course } from "../Data";
import Cart from "../Cart/Cart";
import { FC } from "react";


const Home:FC= ()=> {
  const [state, setState] = useState({ Tittle: "", Author: "" ,ActualPrice:"",Discountedage:"",Tags:""});
        const saveCart = (data: { Author?: string; ActualPrice?: string; Discountedage?: string; Tags?: string; Tittle?: string; Discription?: string; target?: any; })=> {
            const { Author, value } = data.target;
            setState(prevState => ({
                ...prevState,
                [Author]: value
            }));
        };



    return (
      <div className="row">
        <div className="column">
          {Course.map((data, key) => {
            return (
              <div className="stock-container">
                <label className="title">{data.Tittle}</label>
                <label className="author">{data.Author}</label>
                <label className="price">{data.ActualPrice}</label>
                <label className="button">
                  <input type="submit" value="add" onClick={() => saveCart(data)}/>
                </label>
              </div>
            );
          })}
        </div>
        <div>
    <Cart></Cart>
        </div>
      </div>
    );
}

export default Home;
